function TestimonialTile(props) {
  const { name, title, imgPath, text, alt } = props;
  return (
  <div className="testimonial-tile">
    <p>{{ text }}</p>
    <h4>{{ name  }}</h4>
    <p><i>{{ title }} </i></p>
    <img src={ imgPath } alt={ alt }></img>
  </div>
  )
}

export default TestimonialTile
